import {  Routes, Router } from "react-router-dom";
import MainNavigation from "./compenents/layout/MainNavigation";
import Home from "./Home";


function App() {
	return (
		<div>
			<MainNavigation />
			<Routes>
				<Router path="/" element={<Home />} />
			</Routes>
		</div>
	);
}

export default App;
